	"base.modf": "parts = base.modf( 3.14 )\nparts = base.modf( 3.14 )\nparts = base.modf( +0.0 )\nparts = base.modf( -0.0 )\nparts = base.modf( PINF )\nparts = base.modf( NINF )\nparts = base.modf( NaN )\n\n// Provide an output array:\nout = new Float64Array( 2 );\nparts = base.modf( out, 3.14 )\nbool = ( parts === out )\n",
	"base.ndarray": "ctor = base.ndarray( 'float64', 3 )\n\n// To create a new instance...\nb = [ 1, 2, 3, 4 ]; // underlying data buffer\nd = [ 2, 2 ]; // shape\ns = [ 2, 1 ]; // strides\no = 0; // index offset\narr = ctor( b, d, s, o, 'row-major' )\n\n// Get an element using subscripts:\nv = arr.get( 1, 1 )\n\n// Get an element using a linear index:\nv = arr.iget( 3 )\n\n// Set an element using subscripts:\narr.set( 1, 1, 40 );\narr.get( 1, 1 )\n\n// Set an element using a linear index:\narr.iset( 3, 99 );\narr.get( 1, 1 )\n",
